import Typewriter from "typewriter-effect";


export default function MainPage() {
    let app = document.getElementById("app siteTex");
    let test = new Typewriter(app, {
        loop: true
    });
    return (
        <>
            <div className="px-4 py-5 my-5 text-center">
                <h1 className="display-5 fw-bold">Welcome!</h1>
                <div className="app siteText">
                    <Typewriter
                        onInit={(typewriter) => {
                            typewriter
                                .typeString("My name is Adrian Dorado, thanks for stopping by!")
                                .pauseFor(1000)
                                .deleteAll()
                                .typeString("Contact me @ doradocoding@gmail.com")
                                .pauseFor(1000)
                                .deleteAll()
                                .typeString("I hope you enjoy your stay ðŸ’–")
                                .start(test)
                        }}
                    />
                </div>
            </div>
        </>
    );
}
